import React from "react";
import { ListResult } from "../Components/ListResult"

export const SearchingPage = ({ history, results }) => {

	console.log({ history })

	const onNextPage = ({ searchText, getData, start }) => {
		console.log({ start })
		getData();
		history.push(`/search?q=${searchText}&start=${start}`);
		window.scrollTo(0, 0)

	}

	return <>{results.map(result =>
		<ListResult
			key={result.url}
			url={result.url}
			title={result.title}
			snippet={result.snippet}
		/>
	)}
		<button onClick={onNextPage}>next</button>
	</>
}
